import L from 'leaflet';

const iconCompost = new L.Icon({
    iconUrl: require('./img/icon.png'),
    iconRetinaUrl: require('.'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(60, 75),
    className: 'leaflet-div-icon'
});

export { iconCompost };
